import React from 'react';
import { Box, Button, Typography, Container, Paper } from '@mui/material';

function EndGame({ playerScore, aiScore, onRestart }) {
  return (
    <Container maxWidth="sm" sx={{ mt: 40 }}>
      <Paper
        elevation={3}
        sx={{
          padding: 4,
          borderRadius: 2,
          textAlign: 'center',
          backgroundColor: '#f7f9fc',
        }}
      >
        <Box sx={{ textAlign: 'left' }}>
          <Typography variant="h5" gutterBottom>
            Player Score: {playerScore}
          </Typography>
          <Typography variant="h5" gutterBottom>
            AI Score: {aiScore}
          </Typography>
          <Typography variant="h4" gutterBottom>
            {playerScore > aiScore ? 'You Win!' : 'AI Wins!'}
          </Typography>
        </Box>
        <Box sx={{ mt: 4 }}>
          <Button
            variant="contained"
            color="primary"
            size="large"
            onClick={onRestart}
          >
            Restart
          </Button>
        </Box>
      </Paper>
    </Container>
  );
}

export default EndGame;
